import axios from "axios"

const Dashboard = () => {

    const [user,setUser] = useState([])

    const getUser = async() => {
        await axios({
            method : 'post',
            url : 'http://127.0.0.1:8000/auth/list/',
            headers : {
                Authorization:localStorage.getItem('SavedToken')
            },
        }).then((response) => {
            console.log(response.data)
        }).catch((error) => {
            console.error(error)
        })
    }
    
